    "2016-01-09T17:01:59.712159",nt"name": "cost-earnings-survey-of-nwhi-bottomfish-fleets-1993",nt"isopen":
    false,nt"url": null,nt"notes": "This study collected cost-earnings information
    for the 12 vessels which had reported bottomfish landings from Northwestern Hawaiian
    Islands in 1993 in order to examine the economic health of the fleet and assess
    vessel operations and activities relevant to vessel economic returns.  In-person
    interviews with owners and/or captains of all NWHI bottomfish vessels were conducted
    in December 1993 to collect primary information on costs of fishing operations.
     Information on physical characteristics of the vessels, motivation of fishermen,
    and other topics was also collected. M.S. Hamilton conducted this project.",nt"license_title":
